:0,\"like_count\":0,\"quote_count\":0},\"author_id\":\"7820042\",\"possibly_sensitive\":false,\"created_at\":\"2021-04-23T02:25:41.000Z\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1385417980935163904\"}]},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":12,\"username\":\"GemLeighton\"}]},\"text\":\"@GemLeighton Those trees! They are leaning and talking about a forest fire happening a bit far away. The childish lines + the bleak colours! I love it.\",\"lang\":\"en\",\"source\":\"Twitter Web App\",\"in_reply_to_user_id\":\"27779294\",\"id\":\"1385417980935163904\",\"conversation_id\":\"1384807422854848512\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":1,\"like_count\":0,\"quote_count\":0},\"author_id\":\"7820042\",\"possibly_sensitive\":false,\"created_at\":\"2021-04-23T02:19:21.000Z\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1384807422854848512\"}]},{\"text\":\"My boss says I'm very meticulous and well-organised. Me glancing at my multiple Firefox windows full of tabs: \\\"lolwut? \\uD83E\\uDD23\\uD83D\\uDE02\\\"\",\"lang\":\"en\",\"context_annotations\":[{\"domain\":{\"id\":\"46\",\"name\":\"Brand Category\",\"description\":\"Categories within Brand Verticals that narrow down the scope of Brands\"},\"entity\":{\"id\":\"781974596752842752\",\"name\":\"Services\"}},{\"domain\":{\"id\":\"47\",\"name\":\"Brand\",\"description\":\"Brands and Companies\"},\"entity\":{\"id\":\"10052778495\",\"name\":\"Firefox\",\"description\":\"Firefox\"}}],\"source\":\"Twitter Web App\",\"id\":\"1385415642048733188\",\"conversation_id\":\"1385415642048733188\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":0,\"like_count\":0,\"quote_count\":0},\"author_id\":\"7820042\",\"possibly_sensitive\":false,\"created_at\":\"2021-04-23T02:10:03.000Z\"},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":6,\"username\":\"Lazer\"}]},\"text\":\"@Lazer Rule no. 1 of surviving in an Orwellian society: question *everything* *anybody* tries to make you believe, including “I love you”. \\uD83E\\uDD23\\uD83E\\uDD2A\",\"lang\":\"en\",\"source\":\"Twitter for iPhone\",\"in_reply_to_user_id\":\"20121920\",\"id\":\"1385402215473442820\",\"conversation_id\":\"1385311016884609024\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":0,\"like_count\":0,\"quote_count\":0},\"author_id\":\"7820042\",\"possibly_sensitive\":false,\"created_at\":\"2021-04-23T01:16:42.000Z\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1385311016884609024\"}]},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":16,\"username\":\"TimppaKarjalai1\"}]},\"text\":\"@TimppaKarjalai1 This is just to say that you shouldn’t be surprised if some characters sound different in a song than in regular speech, because if the lyricist were worth any salt, they would have written in a way closer to poetry.\",\"lang\":\"en\",\"source\":\"Twitter for iPhone\",\"in_reply_to_user_id\":\"7820042\",\"id\":\"1385097314746781701\",\"conversation_id\":\"1384732009969471489\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":0,\"like_count\":0,\"quote_count\":0},\"author_id\":\"7820042\",\"possibly_sensitive\":false,\"created_at\":\"2021-04-22T05:05:08.000Z\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1385096769466363906\"}]},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":16,\"username\":\"TimppaKarjalai1\"}]},\"text\":\"@TimppaKarjalai1 BTW, I forgot to remind you that many Chinese characters have multiple possible pronunciations, sometimes only differing in tone. And that depends on the context: character combinations, prose-vs-poetry, oral-vs-written, modern-vs-middle-age.\",\"lang\":\"en\",\"source\":\"Twitter for iPhone\",\"in_reply_to_user_id\":\"7820042\",\"id\":\"1385096769466363906\",\"conversation_id\":\"1384732009969471489\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":1,\"like_count\":1,\"quote_count\":0},\"author_id\":\"7820042\",\"possibly_sensitive\":false,\"created_at\":\"2021-04-22T05:02:58.000Z\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1384735710620446720\"}]},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":14,\"username\":\"WesleyCrasher\"},{\"start\":15,\"end\":31,\"username\":\"TimppaKarjalai1\"}]},\"text\":\"@WesleyCrasher @TimppaKarjalai1 However, even *I* cannot be of much help in understanding that article or book. I haven't actually learned much music theory. I'm just a software engineer whose mother tongue is Cantonese. And, officially, my Chinese level should be only about grade 4.\",\"lang\":\"en\",\"source\":\"Twitter Web App\",\"in_reply_to_user_id\":\"7820042\",\"id\":\"1384777556969234434\",\"conversation_id\":\"1384732009969471489\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":0,\"like_count\":1,\"quote_count\":0},\"author_id\":\"7820042\",\"possibly_sensitive\":false,\"created_at\":\"2021-04-21T07:54:32.000Z\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1384776913369985032\"}]},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":14,\"username\":\"WesleyCrasher\"},{\"start\":15,\"end\":31,\"username\":\"TimppaKarjalai1\"}],\"urls\":[{\"start\":184,\"end\":207,\"url\":\"https://t.co/3vPbsHl2kE\",\"expanded_url\":\"https://medium.com/%E8%AA%9E%E7%B5%B2%E8%AB%96%E5%8F%A2/%E9%AB%98%E4%BD%8E%E5%BD%B3%E4%BA%8D%E5%85%A8%E9%80%94%E4%B8%8A-%E4%B8%8A%E4%B8%8B%E5%BE%98%E5%BE%8A%E5%8D%8A%E6%AD%A5%E9%96%93-%E5%BE%9E-%E5%8D%8A%E6%AD%A5%E8%A9%9E-%E8%AB%96%E7%B2%B5%E8%AA%9E%E8%81%B2%E8%AA%BF%E6%9B%B2%E8%AA%BF%E4%BA%92%E5%8B%95%E4%BB%A5%E5%8F%8A%E7%B2%B5%E6%96%87%E5%89%8D%E6%99%AF-%E8%8F%AF%E6%96%87%E7%89%88-2c87bd6ad039\",\"display_url\":\"medium.com/%E8%AA%9E%E7%B…\",\"images\":[{\"url\":\"https://pbs.twimg.com/news_img/1384776914292776960/LbJlqZMx?format=jpg&name=orig\",\"width\":279,\"height\":400},{\"url\":\"https://pbs.twimg.com/news_img/1384776914292776960/LbJlqZMx?format=jpg&name=150x150\",\"width\":150,\"height\":150}],\"status\":200,\"title\":\"高低彳亍全途上，上下徘徊半步間──從《半步詞》論粵語聲調曲調互動以及粵文前景（華文版）\",\"description\":\"《半步詞──由音樂劇到跨媒介的填詞進路》，是資深填詞人岑偉宗的著作，年初出版了。喜見詞人自道的書越來越多，得以觀摩。\",\"unwound_url\":\"https://medium.com/%E8%AA%9E%E7%B5%B2%E8%AB%96%E5%8F%A2/%E9%AB%98%E4%BD%8E%E5%BD%B3%E4%BA%8D%E5%85%A8%E9%80%94%E4%B8%8A-%E4%B8%8A%E4%B8%8B%E5%BE%98%E5%BE%8A%E5%8D%8A%E6%AD%A5%E9%96%93-%E5%BE%9E-%E5%8D%8A%E6%AD%A5%E8%A9%9E-%E8%AB%96%E7%B2%B5%E8%AA%9E%E8%81%B2%E8%AA%BF%E6%9B%B2%E8%AA%BF%E4%BA%92%E5%8B%95%E4%BB%A5%E5%8F%8A%E7%B2%B5%E6%96%87%E5%89%8D%E6%99%AF-%E8%8F%AF%E6%96%87%E7%89%88-2c87bd6ad039\"}]},\"text\":\"@WesleyCrasher @TimppaKarjalai1 There's this article, which is about writing lyrics for Cantonese songs while taking the tones into account, from an experience lyricist's perspective: https://t.co/3vPbsHl2kE\\nThe article is probably just a quick summary of the book 《半步詞──由音樂劇到跨媒介的填詞進路》.\",\"lang\":\"en\",\"source\":\"Twitter Web App\",\"in_reply_to_user_id\":\"942204136631816192\",\"id\":\"1384776913369985032\",\"conversation_id\":\"1384732009969471489\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":1,\"like_count\":1,\"quote_count\":0},\"author_id\":\"7820042\",\"possibly_sensitive\":false,\"created_at\":\"2021-04-21T07:51:58.000Z\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1384762018637418497\"}]},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":16,\"username\":\"TimppaKarjalai1\"}]},\"text\":\"@TimppaKarjalai1 Which is also why I would suggest to avoid some of the more recent songs because some of the composers are brain-dead trained on Western musical theory and do not properly take Cantonese tones into account, and then we have crappy lyricists who write shitty lyrics on top.\",\"lang\":\"en\",\"source\":\"Twitter for iPhone\",\"in_reply_to_user_id\":\"7820042\",\"id\":\"1384735710620446720\",\"conversation_id\":\"1384732009969471489\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":2,\"like_count\":1,\"quote_count\":0},\"author_id\":\"7820042\",\"possibly_sensitive\":false,\"created_at\":\"2021-04-21T05:08:15.000Z\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1384734667413151749\"}]},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":16,\"username\":\"TimppaKarjalai1\"}]},\"text\":\"@TimppaKarjalai1 2. From a musical theory perspective, Chinese folk songs are mostly based on a subset of notes that aren't the same as, say, English folk song or Japanese folk song, exactly because they map better to certain tones. There's probably a book you can read about that.\",\"lang\":\"en\",\"context_annotations\":[{\"domain\":{\"id\":\"55\",\"name\":\"Music Genre\",\"description\":\"A category for a musical style, like Pop, Rock, or Rap\"},\"entity\":{\"id\":\"884775851589419008\",\"name\":\"Folk music\",\"description\":\"Folk\"}}],\"source\":\"Twitter Web App\",\"in_reply_to_user_id\":\"7820042\",\"id\":\"1384734667413151749\",\"conversation_id\":\"1384732009969471489\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":2,\"like_count\":1,\"quote_count\":0},\"author_id\":\"7820042\",\"possibly_sensitive\":false,\"created_at\":\"2021-04-21T05:04:06.000Z\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1384734120329191426\"}]},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":16,\"username\":\"TimppaKarjalai1\"}]},\"text\":\"@TimppaKarjalai1 1. The note and the tone are not (always) directly related.\\nOften, you can express the correct tone through by correctly *varying* the audio frequency *within* the character syllable. It's the varying that matters, and the notes of the song are just adding frequency offsets.\",\"lang\":\"en\",\"source\":\"Twitter Web App\",\"in_reply_to_user_id\":\"7820042\",\"id\":\"1384734120329191426\",\"conversation_id\":\"1384732009969471489\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":2,\"like_count\":2,\"quote_count\":0},\"author_id\":\"7820042\",\"possibly_sensitive\":false,\"created_at\":\"2021-04-21T05:01:56.000Z\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1384733747237441537\"}]},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":16,\"username\":\"TimppaKarjalai1\"}]},\"text\":\"@TimppaKarjalai1 Yes, I realise the tonal property of languages such as Chinese can cause confusion. The really short answer that I would give has two parts.\",\"lang\":\"en\",\"source\":\"Twitter Web App\",\"in_reply_to_user_id\":\"1340536122057904134\",\"id\":\"1384733747237441537\",\"conversation_id\":\"1384732009969471489\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":1,\"like_count\":2,\"quote_count\":0},\"author_id\":\"7820042\",\"possibly_sensitive\":false,\"created_at\":\"2021-04-21T05:00:27.000Z\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1384732009969471489\"}]},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":16,\"username\":\"TimppaKarjalai1\"}]},\"text\":\"@TimppaKarjalai1 Many oldies are slow paced and easy on the vocal chord, which makes them really good for practicing pronunciation. E.g. 「風繼續吹」，「倩女幽魂」，「滄海一聲笑」，etc. Too many to name.\",\"lang\":\"ja\",\"source\":\"Twitter for iPhone\",\"in_reply_to_user_id\":\"1340536122057904134\",\"id\":\"1384683754451394561\",\"conversation_id\":\"1384414105533128709\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":1,\"like_count\":1,\"quote_count\":1},\"author_id\":\"7820042\",\"possibly_sensitive\":false,\"created_at\":\"2021-04-21T01:41:47.000Z\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1384414105533128709\"}]},{\"text\":\"When your leaders volunteer to get a particular vaccine, you say they’re putting up a show.\\n\\nWhen they don’t get a particular vaccine, you say “see? Even they have no confidence in that vaccine!”\\n\\nWhat do you want?\",\"lang\":\"en\",\"context_annotations\":[{\"domain\":{\"id\":\"65\",\"name\":\"Interests and Hobbies Vertical\",\"description\":\"Top level interests and hobbies groupings, like Food or Travel\"},\"entity\":{\"id\":\"903303816698671104\",\"name\":\"Wellness and health\",\"description\":\"Wellness & Health\"}},{\"domain\":{\"id\":\"66\",\"name\":\"Interests and Hobbies Category\",\"descri