52,\"type\":\"Person\",\"normalized_text\":\"Winston\"}]},\"possibly_sensitive\":false,\"created_at\":\"2021-04-22T19:14:18.000Z\"},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":16,\"username\":\"TimppaKarjalai1\"}]},\"text\":\"@TimppaKarjalai1 BTW, I forgot to remind you that many Chinese characters have multiple possible pronunciations, sometimes only differing in tone. And that depends on the context: character combinations, prose-vs-poetry, oral-vs-written, modern-vs-middle-age.\",\"lang\":\"en\",\"source\":\"Twitter for iPhone\",\"in_reply_to_user_id\":\"7820042\",\"id\":\"1385096769466363906\",\"conversation_id\":\"1384732009969471489\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":1,\"like_count\":1,\"quote_count\":0},\"author_id\":\"7820042\",\"possibly_sensitive\":false,\"created_at\":\"2021-04-22T05:02:58.000Z\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1384735710620446720\"}]},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":16,\"username\":\"TimppaKarjalai1\"}]},\"text\":\"@TimppaKarjalai1 Which is also why I would suggest to avoid some of the more recent songs because some of the composers are brain-dead trained on Western musical theory and do not properly take Cantonese tones into account, and then we have crappy lyricists who write shitty lyrics on top.\",\"lang\":\"en\",\"source\":\"Twitter for iPhone\",\"in_reply_to_user_id\":\"7820042\",\"id\":\"1384735710620446720\",\"conversation_id\":\"1384732009969471489\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":2,\"like_count\":1,\"quote_count\":0},\"author_id\":\"7820042\",\"possibly_sensitive\":false,\"created_at\":\"2021-04-21T05:08:15.000Z\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1384734667413151749\"}]},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":14,\"username\":\"WesleyCrasher\"},{\"start\":15,\"end\":31,\"username\":\"TimppaKarjalai1\"}],\"urls\":[{\"start\":184,\"end\":207,\"url\":\"https://t.co/3vPbsHl2kE\",\"expanded_url\":\"https://medium.com/%E8%AA%9E%E7%B5%B2%E8%AB%96%E5%8F%A2/%E9%AB%98%E4%BD%8E%E5%BD%B3%E4%BA%8D%E5%85%A8%E9%80%94%E4%B8%8A-%E4%B8%8A%E4%B8%8B%E5%BE%98%E5%BE%8A%E5%8D%8A%E6%AD%A5%E9%96%93-%E5%BE%9E-%E5%8D%8A%E6%AD%A5%E8%A9%9E-%E8%AB%96%E7%B2%B5%E8%AA%9E%E8%81%B2%E8%AA%BF%E6%9B%B2%E8%AA%BF%E4%BA%92%E5%8B%95%E4%BB%A5%E5%8F%8A%E7%B2%B5%E6%96%87%E5%89%8D%E6%99%AF-%E8%8F%AF%E6%96%87%E7%89%88-2c87bd6ad039\",\"display_url\":\"medium.com/%E8%AA%9E%E7%B…\"}]},\"text\":\"@WesleyCrasher @TimppaKarjalai1 There's this article, which is about writing lyrics for Cantonese songs while taking the tones into account, from an experience lyricist's perspective: https://t.co/3vPbsHl2kE\\nThe article is probably just a quick summary of the book 《半步詞──由音樂劇到跨媒介的填詞進路》.\",\"lang\":\"en\",\"source\":\"Twitter Web App\",\"in_reply_to_user_id\":\"942204136631816192\",\"id\":\"1384776913369985032\",\"conversation_id\":\"1384732009969471489\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":1,\"like_count\":1,\"quote_count\":0},\"author_id\":\"7820042\",\"possibly_sensitive\":false,\"created_at\":\"2021-04-21T07:51:58.000Z\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1384762018637418497\"}]},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":6,\"username\":\"k_sze\"},{\"start\":7,\"end\":23,\"username\":\"TimppaKarjalai1\"}]},\"text\":\"@k_sze @TimppaKarjalai1 wow this is news to me as someone who never understoodmuch about chinesemusic particularly traditionalfolk. I remember when i used to ask how tones come into play for music and the answer I usually got was \\\"you dont\\\" \\nDo you have any examples/material to learn more about this!?\",\"lang\":\"en\",\"source\":\"Twitter Web App\",\"in_reply_to_user_id\":\"7820042\",\"id\":\"1384762018637418497\",\"conversation_id\":\"1384732009969471489\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":1,\"like_count\":1,\"quote_count\":0},\"author_id\":\"942204136631816192\",\"possibly_sensitive\":false,\"created_at\":\"2021-04-21T06:52:47.000Z\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1384734120329191426\"}]},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":16,\"username\":\"TimppaKarjalai1\"}]},\"text\":\"@TimppaKarjalai1 2. From a musical theory perspective, Chinese folk songs are mostly based on a subset of notes that aren't the same as, say, English folk song or Japanese folk song, exactly because they map better to certain tones. There's probably a book you can read about that.\",\"lang\":\"en\",\"context_annotations\":[{\"domain\":{\"id\":\"55\",\"name\":\"Music Genre\",\"description\":\"A category for a musical style, like Pop, Rock, or Rap\"},\"entity\":{\"id\":\"884775851589419008\",\"name\":\"Folk music\",\"description\":\"Folk\"}}],\"source\":\"Twitter Web App\",\"in_reply_to_user_id\":\"7820042\",\"id\":\"1384734667413151749\",\"conversation_id\":\"1384732009969471489\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":2,\"like_count\":1,\"quote_count\":0},\"author_id\":\"7820042\",\"possibly_sensitive\":false,\"created_at\":\"2021-04-21T05:04:06.000Z\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1384734120329191426\"}]},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":16,\"username\":\"TimppaKarjalai1\"}]},\"text\":\"@TimppaKarjalai1 1. The note and the tone are not (always) directly related.\\nOften, you can express the correct tone through by correctly *varying* the audio frequency *within* the character syllable. It's the varying that matters, and the notes of the song are just adding frequency offsets.\",\"lang\":\"en\",\"source\":\"Twitter Web App\",\"in_reply_to_user_id\":\"7820042\",\"id\":\"1384734120329191426\",\"conversation_id\":\"1384732009969471489\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":2,\"like_count\":2,\"quote_count\":0},\"author_id\":\"7820042\",\"possibly_sensitive\":false,\"created_at\":\"2021-04-21T05:01:56.000Z\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1384733747237441537\"}]},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":16,\"username\":\"TimppaKarjalai1\"}]},\"text\":\"@TimppaKarjalai1 Yes, I realise the tonal property of languages such as Chinese can cause confusion. The really short answer that I would give has two parts.\",\"lang\":\"en\",\"source\":\"Twitter Web App\",\"in_reply_to_user_id\":\"1340536122057904134\",\"id\":\"1384733747237441537\",\"conversation_id\":\"1384732009969471489\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":1,\"like_count\":2,\"quote_count\":0},\"author_id\":\"7820042\",\"possibly_sensitive\":false,\"created_at\":\"2021-04-21T05:00:27.000Z\",\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1384732009969471489\"}]},{\"text\":\"I've asked lots of canto speakers how do they sing in note and in right tone simultaneously and I got a bunch of different answers. One of them was \\\"it doesn't matter in a song\\\" - a HK girl and a canto native speaker told me that lolz https://t.co/NFaeMd1iNN\",\"lang\":\"en\",\"source\":\"Twitter for Android\",\"id\":\"1384732009969471489\",\"conversation_id\":\"1384732009969471489\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":1,\"like_count\":0,\"quote_count\":0},\"author_id\":\"1340536122057904134\",\"entities\":{\"urls\":[{\"start\":235,\"end\":258,\"url\":\"https://t.co/NFaeMd1iNN\",\"expanded_url\":\"https://twitter.com/k_sze/status/1384683754451394561\",\"display_url\":\"twitter.com/k_sze/status/1…\"}]},\"possibly_sensitive\":false,\"created_at\":\"2021-04-21T04:53:32.000Z\",\"referenced_tweets\":[{\"type\":\"quoted\",\"id\":\"1384683754451394561\"}]},{\"text\":\"Today is apparently Chinese Language Day or something. I'm listening to old Grasshopper record on Spotify and thinking how the heck did I manage not learning at least basic Cantonese in 20+ years listening to cantopop and watching HK movies? Bad Timppa\",\"lang\":\"en\",\"context_annotations\":[{\"domain\":{\"id\":\"45\",\"name\":\"Brand Vertical\",\"description\":\"Top level entities that describe a Brands industry\"},\"entity\":{\"id\":\"781974597310615553\",\"name\":\"Entertainment\"}},{\"domain\":{\"id\":\"46\",\"name\":\"Brand Category\",\"description\":\"Categories within Brand Verticals that narrow down the scope of Brands\"},\"entity\":{\"id\":\"781974597222535168\",\"name\":\"Online Services\"}},{\"domain\":{\"id\":\"47\",\"name\":\"Brand\",\"description\":\"Brands and Companies\"},\"entity\":{\"id\":\"10040276669\",\"name\":\"Spotify\"}}],\"source\":\"Twitter for Android\",\"id\":\"1384414105533128709\",\"conversation_id\":\"1384414105533128709\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":3,\"like_count\":6,\"quote_count\":0},\"author_id\":\"1340536122057904134\",\"entities\":{\"annotations\":[{\"start\":20,\"end\":39,\"probability\":0.6406,\"type\":\"Other\",\"normalized_text\":\"Chinese Language Day\"},{\"start\":98,\"end\":104,\"probability\":0.6836,\"type\":\"Product\",\"normalized_text\":\"Spotify\"}]},\"possibly_sensitive\":false,\"created_at\":\"2021-04-20T07:50:18.000Z\"},{\"entities\":{\"mentions\":[{\"start\":0,\"end\":6,\"username\":\"k_sze\"}],\"annotations\":[{\"start\":39,\"end\":40,\"probability\":0.5242,\"type\":\"Place\",\"normalized_text\":\"HK\"},{\"start\":176,\"end\":177,\"probability\":0.5759,\"type\":\"Place\",\"normalized_text\":\"HK\"},{\"start\":246,\"end\":248,\"probability\":0.5138,\"type\":\"Organization\",\"normalized_text\":\"CPC\"}]},\"text\":\"@k_sze Yeah but it's a recent thing in HK history's course isn't it.\\n\\nAlso even lots of blue camp are more pragmatic than genuinely patriotic of PRC, aren't they. I met ppl in HK who are proud of being Chinese and put in the past their beef with CPC, but at best they're neutral.\",\"lang\":\"en\",\"source\":\"Twitter for Android\",\"in_reply_to_user_id\":\"7820042\",\"id\":\"1383650820026077185\",\"conversation_id\":\"1383644407744765954\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":1,\"like_count\":0,\"quote_count\":0},\"author_id\":\"13405